import React from 'react';
import CountUp from 'react-countup';

function Counter({end, duration, prefix, suffix}){
    return(
        <div>
            <CountUp start={0} end={end} duration={duration} prefix={prefix} suffix={suffix} />
        </div>
    )
}

export default Counter;
